import ExpenseItem from "./components/ExpenseItem";
import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    {
      title: "Car insurance",
      price: 249.99,
      date: new Date(2022, 3, 10),
    },
    {
      title: "Table",
      price: 333.99,
      date: new Date(2020, 1, 24),
    },
    {
      title: "Iphone 14",
      price: 1654.99,
      date: new Date(2007, 9, 14),
    },
    {
      title: "PC",
      price: 122.99,
      date: new Date(2019, 7, 20),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses></Expenses>
    </div>
  );
}

export default App;
